package JavaBasics;

public class Comparision {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		
		int a=59;
		int b=14;
		int c=a+b;
		if(c<10)
		{
			for(int i=1;i<=5;i++)
			{
				System.out.println(i);
				
			}
		}
		else
		{
			if(c>10&&c<20)
			{
				for(int j=5;j<=10;j++)
				{
					System.out.println(j);
				}
			}
			else
			{
				for(int k=10;k<=15;k++)
				{
					System.out.println(k);
				}
			}
				
		}
	}

}
